import React, {Component} from 'react';

import './register.css';

class Register extends Component {
   
    constructor(props) {
        super();
        this.state = {
            form: {
                nmFantazy: '',
                cnpj: '',

                idUser: '',
                emailUser: '',

                street: '',
                number: '',
                complement: '',
                neighborhood: '',
                city: '',
                state: '',
                uf: '',
                zip: '',
 
                phone: '',
                phoneAdd: '',
                cellPhone: '',
                cellPhoneAdd: '',

                email: '',
                emailAdd: '',
                site: '',
                facebook: '',
                otherUrl: '',              
            },
            token: '',
        }
        this.input = this.input.bind(this);
    }

    componentDidMount() {
        let token = localStorage.getItem('token');
        this.setState({token: token});
        let form = this.state.form;
        form.email = localStorage.getItem('email');
        form.idUser = localStorage.getItem('idUser');
        this.setState({form: form})
    }



    cadastrar(e){
        console.log();
    }

    render(){
        return(
            <div id='formContainerRegister'>
                <h1>Cadastrar</h1>  
                <form onSubmit={this.input} id='login'>
                    <label>E-mail:</label>
                    <input type='text' autoComplete='off' autoFocus value={this.state.form.email}
                    onChange={this.logar} placeholder='email@email.com.br' name='email' />
                    <label>Senha:</label>
                
                    <button>Enviar</button>
                </form> 
            </div>
        )
    }
}
export default Register;
